int time = 0;
int timeframe = 20;

int sound_time = time_sounds[0];
int current_sound = 0;

void draw_frame(int current_frame)
{
  for(int l = 0; l < 8; ++l)
    {
      int current_line[8] = line[l+(8*current_frame)];
      for(int i = 0; i < 8; ++i)
      {
        
        if(current_line[i] == 1)
        {
          blackbox.matrix.pixel(i+(l*8) ).turn_on();
        }
        else
        {
          blackbox.matrix.pixel(i+(l*8)).turn_off();
        }
        
      }
    }
}

void change_frame()
{
  if(current_frame < max_frame){
    timeframe = time+20;
    current_frame = current_frame+1;
  }
}

void play_sound(){
  blackbox.piezo.tone( sounds[current_sound] );
}

// Your main loop goes here!
void main() {
  while (1) {
    
    play_sound();
    
    time = time + 1;
    sound_time -= 0.00009;
    if(sound_time <= 0){
      sound_time = time_sounds[current_sound];
      current_sound += 1;
    }
    if(time >= timeframe){
      draw_frame(current_frame);
      change_frame();
    }
  }
}
